function hashColor(key, palette){if(!key)return palette[palette.length-1];const h=Array.from(String(key)).reduce((a,c)=>a+c.charCodeAt(0),0);return palette[h%palette.length];}

function shieldDot(rec){const styleRaw=(rec?.ShieldStyle||'').toString();let color=(rec?.ShieldColor||'').toString().trim();if(!color){const m=styleRaw.match(/color\s*:\s*([^;]+)/i);if(m&&m[1])color=m[1].trim();}if(!color)return '';return `<span class="shield-icon" title="Shield" style="color:${color};"><svg viewBox='0 0 16 18' width='12' height='14' aria-hidden='true'><path fill='${color}' stroke='#0b1220' stroke-width='0.6' d='M8 1.2l5.5 2v4.3c0 2.9-1.6 5.6-4.2 7.2L8 15.9l-1.3-.8C4 13.1 2.5 10.4 2.5 7.5V3.2z'/></svg></span>`;}

function posStr(v){if(v===undefined||v===null||v==='')return '';const n=Number(v);if(Number.isNaN(n))return '';return `#${Math.round(n)}`;}

const grid=document.getElementById('grid');

function formatNum(n){if(n===null||n===undefined)return'0';return Number(n).toLocaleString('tr-TR');}

const rankThresholds=rosterData.rankBucketThresholds||[];

const strengths=rosterData.familyStrength||{};

const cityScores={};

const cityNames=Object.keys(rosterData.cityBuckets||{});

cityNames.forEach(city=>{const fams=rosterData.cityBuckets[city]||[];cityScores[city]=fams.reduce((acc,f)=>acc+Number(strengths[f]||0),0);});

const cities=cityNames.sort((a,b)=>{const sa=Number(cityScores[a]||0);const sb=Number(cityScores[b]||0);if(sb!==sa)return sb-sa;return a.localeCompare(b);});

cities.forEach(city=>{
  const fams=(rosterData.cityBuckets[city]||[]).slice();
  fams.sort((a,b)=>{const sa=Number(strengths[a]||0);const sb=Number(strengths[b]||0);if(sb!==sa)return sb-sa;return String(a).localeCompare(String(b));});
  const cityCard=document.createElement('div');
  cityCard.className='city-card';
  const tint=hashColor(city,cityPalette);
  const cityScore=Math.round(Number(cityScores[city]||0));
  cityCard.innerHTML=`<div class="city-title"><span>${city}</span><span style="background:${tint}; padding:4px 8px; border-radius:8px; font-size:12px; font-weight:700;">${fams.length} aile ¬∑ ${formatNum(cityScore)} p</span></div>`;
  fams.forEach(fam=>{
    const members=rosterData.familyMembers[fam]||[];
    const sizeLabel=(rosterData.familySizes||{})[fam]||'';
    const headcount=(rosterData.familyHeadcounts||{})[fam];
    const bucket=(rosterData.familyRankBuckets||{})[fam]||{};
    const strengthVal=rosterData.familyStrength?.[fam];
    const strength=(strengthVal===undefined)?undefined:Math.round(Number(strengthVal)||0);
    const famRow=document.createElement('div');
    famRow.className='fam-row';
    const metaBits=[`${members.length} √ºye`];
    if(strength!==undefined)metaBits.push(`${formatNum(strength)} p`);
    const metaLabel=metaBits.join(' ¬∑ ');
    famRow.innerHTML=`<button class="toggle" aria-expanded="false">+</button><span class="fam-name">${fam}</span><span class="fam-meta">${metaLabel}</span>`;
    const membersBox=document.createElement('div');
    membersBox.className='members';
    if(members.length<=10) membersBox.classList.add('inline-members');
    membersBox.setAttribute('data-fam',fam);
    membersBox.innerHTML=members.map(m=>{const pos=posStr(m.Pos);const rank=m.Rank?` ${m.Rank}`:'';const shield=shieldDot(m);const href=m.UserHref?`https://www.barafranca.com${m.UserHref}`:'';const linkOpen=href?`<a href="${href}" target="_blank" rel="noreferrer" style="color:inherit; text-decoration:none;">`:'';const linkClose=href?'</a>':'';return `<div class="member-line">${shield}<span class="member-name">${linkOpen}${m.Name||''}${linkClose}</span><span class="member-meta">${pos}${rank}</span></div>`;}).join('');
    const detail=document.createElement('div');
    detail.className='fam-detail';
    detail.style.display='none';
    const bucketSummary=(rankThresholds||[]).map(t=>{const v=bucket[String(t)]||0;return v?`ƒ∞lk ${t}: ${v}`:'';}).filter(Boolean).join('<br>');
    const sizeLine=sizeLabel||'-';
    const headLine=(headcount!==undefined)?headcount:'-';
    detail.innerHTML=`<div class="detail-line"><strong>Top sayƒ±larƒ±:</strong> ${bucketSummary||'-'}</div><div class="detail-line"><strong>Kapasite:</strong> ${sizeLine}</div><div class="detail-line"><strong>Headcount:</strong> ${headLine}</div>`;
    const strengthBadge=document.createElement('button');
    strengthBadge.className='strength-btn';
    strengthBadge.textContent=(strength!==undefined)?`${formatNum(strength)} p`:'Puan: -';
    strengthBadge.onclick=(ev)=>{ev.preventDefault();ev.stopPropagation();const open=detail.style.display==='block';detail.style.display=open?'none':'block';};
    const metaWrap=famRow.querySelector('.fam-meta');
    if(metaWrap){metaWrap.textContent=`${members.length} √ºye`;metaWrap.appendChild(strengthBadge);}const copyBtn=document.createElement('button');copyBtn.className='copy-btn';copyBtn.textContent='Kopyala';copyBtn.style.display='none';copyBtn.onclick=(ev)=>{ev.preventDefault();ev.stopPropagation();const names=members.map(m=>m.Name).join('\n');navigator.clipboard.writeText(names).then(()=>{copyBtn.textContent='‚úì';copyBtn.classList.add('copied');setTimeout(()=>{copyBtn.textContent='Kopyala';copyBtn.classList.remove('copied');},1500);});};membersBox.insertBefore(copyBtn,membersBox.firstChild);
    famRow.onclick=()=>{const isInline=membersBox.classList.contains('inline-members');const open=membersBox.style.display===(isInline?'flex':'block');membersBox.style.display=open?'none':(isInline?'flex':'block');copyBtn.style.display=open?'none':'block';const btn=famRow.querySelector('.toggle');if(btn)btn.textContent=open?'+':'‚àí';};
    cityCard.appendChild(famRow);
    cityCard.appendChild(detail);
    cityCard.appendChild(membersBox);
  });
  grid.appendChild(cityCard);
});

let allExpanded=false;function setAll(open){allExpanded=open;document.querySelectorAll('.members').forEach(box=>{box.style.display=open?'block':'none';});document.querySelectorAll('.copy-btn').forEach(btn=>{btn.style.display=open?'block':'none';});document.querySelectorAll('.fam-row .toggle').forEach(btn=>{btn.textContent=open?'‚àí':'+';});const toggleBtn=document.getElementById('toggleAllBtn');if(toggleBtn)toggleBtn.textContent=open?'T√ºm√ºn√º Kapat':'T√ºm√ºn√º A√ß';}
